import {
  HomeOutlined,
  UserOutlined,
  UserAddOutlined,
  UsergroupAddOutlined,
  SafetyOutlined,
  TeamOutlined,
  ScheduleOutlined,
  SolutionOutlined
} from "@ant-design/icons";

const sidebar = [
  {
    routeName: "frontend.admin.dashboard.index",
    icon: <HomeOutlined />,
    routeParams: {},
  },
  {
    routeName: "frontend.admin.users.index",
    icon: <UserOutlined />,
    routeParams: {}
    // type: "sub",
  },
  {
    routeName: "frontend.admin.rooms.index",
    icon: <SafetyOutlined />,
    routeParams: {}
    // type: "sub",
  },
  {
    routeName: "frontend.admin.beds.index",
    icon: <SafetyOutlined />,
    routeParams: {}
    // type: "sub",
  },
  {
    routeName: "frontend.admin.patients.index",
    icon: <UserOutlined />,
    routeParams: {}
    // type: "sub",
  },
  {
    routeName: "frontend.admin.assignment",
    icon: <ScheduleOutlined />,
    routeParams: {},
    type: "sub",
    children: [
      {
        routeName: "frontend.admin.doctorAssignments.index",
        icon: <SolutionOutlined />,
        routeParams: {}
      },
      {
        routeName: "frontend.admin.nursingAssignments.index",
        icon: <SolutionOutlined />,
        routeParams: {}
      }
    ]
  },
  {
    routeName: "frontend.admin.adminsIndex",
    icon: <TeamOutlined />,
    routeParams: {},
    type: "sub",
    children: [
      {
        routeName: "frontend.admin.userGroups.index",
        icon: <UsergroupAddOutlined />,
        routeParams: {}
      },
      {
        routeName: "frontend.admin.admins.index",
        icon: <UserAddOutlined />,
        routeParams: {}
      }
    ]
  }
];

export default sidebar;
